import React from 'react';
import { 
  createBrowserRouter, 
  RouterProvider,
  createRoutesFromElements,
  Route
} from 'react-router-dom';
import { Hero } from './components/Hero/Hero';

// 仮のコンポーネント定義
const Header = () => <header>Header</header>;
const Benefits = () => <div>Benefits</div>;
const TechStack = () => <div>TechStack</div>;
const Positions = () => <div>Positions</div>;
const Culture = () => <div>Culture</div>;
const Contact = () => <div>Contact</div>;

// ルート定義（futureオプションを削除）
const router = createBrowserRouter(
  createRoutesFromElements(
    <Route path="/" element={
      <div className="app">
        <Header />
        <main>
          <Hero />
          <Benefits />
          <TechStack />
          <Positions />
          <Culture />
          <Contact />
        </main>
      </div>
    }>
      <Route path="positions" element={<Positions />} />
    </Route>
  )
);

const App: React.FC = () => {
  return <RouterProvider router={router} />;
};

export default App;
